	<body>
		<div id="welcome">
			<p>Bienvenue sur Place Cast</p>
			<br>
			<p>Selectionnez une vidéo sur votre téléphone</p>
		</div>
		<div id="player"></div>
		<script type="text/javascript" src="//www.gstatic.com/cast/sdk/libs/receiver/2.0.0/cast_receiver.js"></script>
		<script type="text/javascript">
		// YOUTUBE
		
		var tag = document.createElement('script');

		tag.src = "https://www.youtube.com/iframe_api";
		var firstScriptTag = document.getElementsByTagName('script')[0];
		firstScriptTag.parentNode.insertBefore(tag, firstScriptTag);

		var player;
		var currentQuality = 'hd1080';
		var YTiFrameReady = false;
		var isYTStarted = false;
		var logTAG = 'PlaceCastLog';
		
		function log(text) {
			console.log(logTAG + ': ' + text);
		}
		
		function onYouTubeIframeAPIReady() {
			YTiFrameReady = true;
		}
		
		function startPlayer(id) {
			player = new YT.Player('player', {
				height: '720',
				width: '1280',
				videoId: id,
				events: {
					'onReady': onPlayerReady,
					'onStateChange': onPlayerStateChange
				}
			});
		}

		function onPlayerReady(event) {
			event.target.playVideo();
			player.setPlaybackQuality(currentQuality);
		}

		function onPlayerStateChange(event) {
		}
		
		function stopVideo() {
			player.stopVideo();
		}
		
		// CHROMECAST
		
		window.onload = function() {
			cast.receiver.logger.setLevelValue(0);
			window.castReceiverManager = cast.receiver.CastReceiverManager.getInstance();
			log('Starting Receiver Manager');

			castReceiverManager.onReady = function(event) {
				log('Received Ready event: ' + JSON.stringify(event.data));
				window.castReceiverManager.setApplicationState("Application status is ready...");
			};

			castReceiverManager.onSenderConnected = function(event) {
				log('Received Sender Connected event: ' + event.data);
				log(window.castReceiverManager.getSender(event.data).userAgent);
			};

			castReceiverManager.onSenderDisconnected = function(event) {
				log('Received Sender Disconnected event: ' + event.data);
				if (window.castReceiverManager.getSenders().length == 0) {
					window.close();
				}
			};

			castReceiverManager.onSystemVolumeChanged = function(event) {
				log('Received System Volume Changed event: ' + event.data['level'] + ' ' +
				event.data['muted']);
				window.messageBus.send(event.senderId, event.data);
			};

			window.messageBus = window.castReceiverManager.getCastMessageBus('urn:x-cast:net.voidmx.placecast');

			window.messageBus.onMessage = function(event) {
				log('Message [' + event.senderId + ']: ' + event.data);
				
				var json = JSON.parse(event.data);
				
				if (json.control == 'startVideo') {
					loadVideo(json.data);
				}
				
				if (json.control == 'playVideo') {
					player.playVideo();
				}
				
				if (json.control == 'pauseVideo') {
					player.pauseVideo();
				}
				
				if (json.control == 'stopVideo') {
					player.stopVideo();
				}
				
				//window.messageBus.send(event.senderId, event.data);
			}

			window.castReceiverManager.start({statusText: "Application is starting"});
			log('Receiver Manager started');
		};

		function displayText(text) {
			log(text);
			document.getElementById("message").innerHTML=text;
			window.castReceiverManager.setApplicationState(text);
		};
		
		function loadVideo(id) {
			if (YTiFrameReady && !isYTStarted) {
				hideWelcome();
				startPlayer(id);
				isYTStarted = true;
			}
			else {
				log('loadVideo ' + id);
				player.loadVideoById(id); // loadVideo('RDfjXj5EGqI');
				player.setPlaybackQuality(currentQuality);
				player.playVideo();
			}
			
			
		}
		
		function hideWelcome() {
			document.getElementById('welcome').style.display = 'none';
		}
		</script>
	</body>
</html>
